import React from "react";

const Leaguetable = ({ data }) => {
  console.log(data[0].Position);
  return (
    <>
      {data.map((item) => {
        return (
          <div className="flex  w-full h-[60px] justify-between text-black">
            <h1>{data.Position}</h1>
            <h1>{data.Name}</h1>
            <h1>{data.Played}</h1>
            <h1>{data.Loosed}</h1>
          </div>
        );
      })}
      ;
    </>
  );
};

export default Leaguetable;
